import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { ScrollView } from 'react-native';
import CancelIcon from '@material-ui/icons/Cancel';
import { IconButton } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    texttitle: {
        fontSize: '22.6px',
        fontWeight: 'bold',
        color: '#4A4A4A'
    },
    subTitle: {
        fontSize: '16.18px',
        color: '#4A4A4A'

    },
    frame: {
        width: "554px",
        height: "336px",
        backgroundColor: "#FFFFFF",
        position: "relative"

    },
    inner: {
        width: "464px",
        height: "249px",
        position: "relative",
        margin: 'auto'
    },
    superinner: {
        width: "363px",
        height: "190.6px",
        position: "relative",
        margin: 'auto',
    },
    linedivider: {
        backgroundColor: "#D8D8D8",
        height: "1px",
        width: "100%"
    },
    reicon: {
        width: "31.5px",
        height: "31.5px",
        position: "absolute",
        color: "#EFEFEF",
    },
    backIcon: {
        backgroundColor: "#4A4A4A",
        width: "25px",
        height: "25px",
        position: "absolute",
        borderRadius: 30,
        right: 0,
        margin: "30px 40px 0px 0px"
    }
}))

export default function DialogDetail() {
    const classes = useStyles()

    // const [building, setBuilding] = useState([])

    // useEffect(() => {
    //     axios('/building/buildings')
    //         .then(response => {
    //             console.log(response.data)
    //             setBuilding(response.data);
    //         })
    //         .catch(error => {
    //             console.log('Error getting fake data: ' + error);
    //         })
    // }, []);

    return (
        <div className={classes.frame}>
            <div className={classes.backIcon}>
                <IconButton className={classes.reicon} style={{ marginLeft: -4, marginTop: -3 }}>
                    <CancelIcon className={classes.reicon}>


                    </CancelIcon>

                </IconButton>
            </div>


            <div style={{ height: 44 }} />
            <div className={classes.inner}>
                <div className={classes.texttitle}>
                    Set A
                </div>
                <div style={{ height: 22 }} />
                <div className={classes.linedivider}></div>
                <div style={{ height: 21 }} />

                <ScrollView>
                    <div className={classes.superinner}>
                        {/* {building.map((value, index) => ( */}
                        <div>
                            <div style={{ display: 'flex' }}>
                                <div className={classes.subTitle}>
                                    Room price
                                </div>
                                <div className={classes.subTitle} style={{ position: "absolute", right: 63 }}>
                                    4,000.00
                                </div>
                                <div className={classes.subTitle} style={{ position: "absolute", right: 0 }}>
                                    THB
                                </div>
                            </div>
                            <div style={{ height: 12 }} />
                        </div>
                        {/* ))} */}


                    </div>

                </ScrollView>

            </div>
        </div>
    )
}
